INSERT INTO `products` (`id`, `name`, `image`, `price`, `year`, `category`, `quantity`, `description`, `model`, `created_at`, `updated_at`) VALUES
(2, 'HP LaserJet Pro M404n', 'a36b4b559ac69a6fbc40a49fcd5507884305a664.jpg', 18990, 2020, 1, 3, 'Черно-белый лазерный принтер с мощным процессором и высокой скоростью печати до 38 страниц в минуту. Обладает функцией автоматического двустороннего печати и подключением по Ethernet.', '2020', '2023-03-08 17:10:26', '2023-03-08 17:10:26'),
(3, 'Canon i-SENSYS LBP6030w', 'a28823cdf04e7b1ad2aacc9033cd5bf12308d418.jpg', 6990, 2017, 1, 5, 'Компактный черно-белый лазерный принтер с беспроводным подключением и высокой скоростью печати до 18 страниц в минуту. Идеально подходит для домашнего использования или малых офисов.', '2017', '2023-03-08 17:11:00', '2023-03-08 17:11:00'),
(4, 'Xerox Phaser 6510', 'aa72b1d70006462a6455d9164a52284b622.jpg', 32990, 2018, 1, 11, 'Цветной лазерный принтер с высоким разрешением печати до 1200x2400 точек на дюйм. Обладает функцией автоматической двусторонней печати и подключением по Ethernet.', '2018', '2023-03-08 17:11:34', '2023-03-08 17:11:34'),
(5, 'Samsung Xpress SL-M2070FW', 'bbd6e8f5d231394fe05bc35e441dd6a266878d5.jpg', 13990, 2016, 1, 6, 'Многофункциональный черно-белый лазерный принтер с функциями печати, сканирования, копирования и отправки факсов. Обладает беспроводным подключением и автоматической двусторонней печатью.', '2016', '2023-03-08 17:12:35', '2023-03-08 17:12:35'),
(6, 'Brother HL-L2375DW', 'bcb36e7704bb2399e9320beaad6eac63ddfaa2.jpg', 11490, 2019, 1, 4, 'Черно-белый лазерный принтер с функцией автоматической двусторонней печати и высокой скоростью печати до 34 страниц в минуту. Имеет беспроводное подключение и возможность печати с мобильных устройств.', '2019', '2023-03-08 17:13:02', '2023-03-08 17:13:02'),
(7, 'Epson EcoTank L3150', 'bed9020f719d3312d1adaecbcd4336d053a0027.jpg', 13490, 2019, 2, 2, 'Многофункциональный струйный принтер с системой непрерывной подачи чернил и возможностью печати без краев. Обладает высокой скоростью печати до 33 страниц в минуту и подключением по Wi-Fi.', '2019', '2023-03-08 17:15:23', '2023-03-08 17:15:23'),
(8, 'Canon PIXMA G2411', 'c5fe8d3b1e75b49f2ea123f3c7d15fdd87.jpg', 10990, 2017, 2, 5, 'Многофункциональный струйный принтер с высокой скоростью печати до 8 страниц в минуту и системой непрерывной подачи чернил. Обладает функциями копирования и сканирования, а также подключением по USB.', '2017', '2023-03-08 17:15:59', '2023-03-08 17:16:55'),
(9, 'HP DeskJet Ink Advantage 5275', 'c6f9f831f23f01b194c293d4e6275dae9696f.jpg', 8990, 2018, 2, 14, 'Многофункциональный струйный принтер с высоким разрешением печати до 4800x1200 точек на дюйм и возможностью печати без краев. Обладает функциями копирования, сканирования и отправки факсов, а также беспроводным подключением.', '2018', '2023-03-08 17:16:36', '2023-03-08 17:17:23'),
(10, 'Brother DCP-T310', 'cdaea3dcd244b299a48db4367b8eefbbf.jpg', 10490, 2019, 2, 24, 'Многофункциональный струйный принтер с высокой скоростью печати до 27 страниц в минуту и системой непрерывной подачи чернил. Обладает функциями копирования и сканирования, а также подключением по USB.', '2019', '2023-03-08 17:18:56', '2023-03-08 17:19:48'),
(11, 'Epson WorkForce WF-2850DWF', 'ce38d65eb5923f315f9df9a33e93fc92.jpg', 16990, 2020, 2, 33, 'Многофункциональный струйный принтер с возможностью печати без краев и высокой скоростью печати до 10 страниц в минуту. Обладает функциями копирования, сканирования и отправки факсов, а также беспроводным подключением.', '2020', '2023-03-08 17:19:28', '2023-03-08 17:19:39'),
(12, 'Zebra GX430t', 'cf4825f502a5e0cc4108b33e0877da29bc.jpg', 79990, 2019, 3, 2, 'Термотрансферный принтер с высокой скоростью печати до 4 дюймов в секунду и разрешением печати до 300 dpi. Обладает функцией автоматической подачи этикеток и подключением по USB и Ethernet.', '2019', '2023-03-08 17:20:31', '2023-03-08 17:20:31'),
(13, 'Bixolon SLP-TX420', 'df1779b4d30feb624098143c188fba1517c948c14.jpg', 54990, 2018, 3, 6, 'Термотрансферный принтер с высокой скоростью печати до 7 дюймов в секунду и разрешением печати до 203 dpi. Обладает функцией автоматической подачи этикеток и подключением по USB и Ethernet.', '2018', '2023-03-08 17:21:12', '2023-03-08 17:23:43'),
(14, 'TSC TTP-244 Pro', 'eb6909c73f2114cdaf62fc4a4cf46035beb0ae4912.jpg', 37990, 2017, 3, 11, 'Термотрансферный принтер с высокой скоростью печати до 4 дюймов в секунду и разрешением печати до 203 dpi. Обладает функцией автоматической подачи этикеток и подключением по USB, Ethernet и RS-232.', '2017', '2023-03-08 17:22:00', '2023-03-08 17:22:00'),
(15, 'Citizen CL-S621', 'ec4457f38f04e119add118ef010b85a2629ec5.jpg', 58990, 2019, 3, 9, 'Термотрансферный принтер с высокой скоростью печати до 4 дюймов в секунду и разрешением печати до 203 dpi. Обладает функцией автоматической подачи этикеток и подключением по USB, Ethernet и RS-232.', '2019', '2023-03-08 17:22:31', '2023-03-08 17:22:31'),
(16, 'Godex EZ2250i', 'efeb472d10ed096b0761022b117561f84b77fd.jpg', 45990, 2020, 3, 7, 'Термотрансферный принтер с высокой скоростью печати до 5 дюймов в секунду и разрешением печати до 203 dpi. Обладает функцией автоматической подачи этикеток и подключением по USB, Ethernet и RS-232.', '2020', '2023-03-08 17:22:57', '2023-03-08 17:23:08');